	/**
	 * 心电字符串转数组
	 * @param value
	 * @return
	 * @throws Exception
	 */
	public static int[] intValue(String value) throws Exception {
        //String value = "";
        //value = "";
        if (value == null || value.length() <= 100) {
            return new int[0];
        }
        byte[] out = null;
        out = Base64.decodeBase64(value);
        byte[] f = new byte[4];
        f[3] = out[0];
        f[2] = out[1];
        f[1] = out[2];
        f[0] = out[3];
        List<Integer> vList = new ArrayList<Integer>();
        for (int i = 4; i < out.length; i++) {
            f = new byte[2];
            f[1] = out[ i + 0];
            f[0] = out[ i + 1];
            //System.out.println(toInt(f));
            vList.add(toInt(f));
            i++;
        }
        int []b = new int[vList.size()];
        for (int i = 0; i < vList.size(); i++) {
            b[i] = vList.get(i);
        }
        return b;
    }

    public static int toInt(byte[] bRefArr) {
        int iOutcome = 0;
        byte bLoop;
        for (int i = 0; i < bRefArr.length; i++) {
            bLoop = bRefArr[i];
            iOutcome += (bLoop & 0xFF) << (8 * i);
        }
        return iOutcome;
    }
    
