    private static boolean isNotNull(Object value) {
        if (value != null && !value.equals("")) {
            return true;
        }
        return false;
    }

    private static int addLine(int lastY, double wufuup, double wufudown, int[] value, int dxs, double ets, int startY, double wufuzjz, double zxs, Graphics2D g, int maxX, int startX, String name) {
        if (value == null || value.length < 10) {
            return lastY;
        }
        double st = 0;
        double et = ets;
        int i = 1;
        int maxY = 0;

        int minY = (int) (startY - (value[0] - wufuzjz) * zxs);
        for (int j = 1; j < value.length; j++) {
            if(et > value.length - 1) {
                et = value.length - 1;
            }
            for (int k = (int) st; k < et; k++) {
                int yst = (int) (startY - (value[k] - wufuzjz) * zxs);
                int yet = (int) (startY - (value[k + 1] - wufuzjz) * zxs);
                if (yst < minY)
                    minY = yst;
                if (yet < minY)
                    minY = yet;
            }
            if (j + startX >= maxX) {
                break;
            }
            st = et;
            et = et + ets;
        }

        int ystl = (int) (startY - (wufuup - wufuzjz) * zxs);
        int yetl = (int) (startY - (wufudown - wufuzjz) * zxs);
        if (ystl < minY)
            minY = ystl;
        if (yetl < minY)
            minY = yetl;
        if (lastY > minY) {
            startY = startY + (lastY - minY) + 10;
        }

        st = 0;
        et = ets;
        //BasicStroke stokeLine = new BasicStroke(1f);//加上锯齿
        //g.setStroke(stokeLine);
        g.setColor(Color.BLACK);
        for (; i < value.length / dxs; i++) {
            if(et > value.length - 1) {
                et = value.length - 1;
            }
            for (int k = (int) st; k < et; k++) {
                int yst = (int) (startY - (value[k] - wufuzjz) * zxs);
                int yet = (int) (startY - (value[k + 1] - wufuzjz) * zxs);
                if (yst > maxY)
                    maxY = yst;
                if (yet > maxY)
                    maxY = yet;
                g.drawLine(i + startX, yst, i + startX, yet);
            }
            st = et;
            et = et + ets;
            if (i + startX >= maxX) {
                break;
            }
        }

        //stokeLine = new BasicStroke(2.0f);//加上锯齿
        //g.setStroke(stokeLine);

        ystl = (int) (startY - (wufuup - wufuzjz) * zxs);
        yetl = (int) (startY - (wufudown - wufuzjz) * zxs);
        //System.out.println("S:" + ystl + ";E:" + yetl);
        if (ystl > maxY)
            maxY = ystl;
        if (yetl > maxY)
            maxY = yetl;
        g.setColor(new Color(7, 59, 6));
        g.drawLine(i + startX - 20 , ystl, i + startX - 20, yetl);
        g.drawLine(i + startX - 19 , ystl, i + startX - 19, yetl);
        g.drawLine(i + startX - 18 , ystl, i + startX - 18, yetl);
        g.setFont(new Font("TimesRoman", Font.BOLD, 20));
        g.drawString(name, i + startX - 15, yetl + 10);
        g.setFont(new Font("TimesRoman", Font.BOLD, 14));
        //g.drawString("1mv", i + startX - 15, ystl - 2);
        return maxY;
    }
    
